import React from "react";
import { Redirect, Link } from "react-router-dom";

export default function Header(set) {
  const handleClick = () => {
    sessionStorage.clear();
    return <Redirect to={"/"} />;
  };

  return (
    <div>
      <div className="callout primary" id="Header">
        <div className="row column">
          <button>
            <Link to={"/"} />
            logout
          </button>
        </div>
      </div>
    </div>
  );
}
